description:
Techno &amp; Dance compilations 1-9

All the best techno &amp; dance songs from 1992 to 1998, this is a must have if you&amp;#039;re into the music of the 90&amp;#039;s. Especially the first albums are awesome for their old techno songs!

I would love to post the tracklists here but as there are 9 albums of which some are 2CD I prefer to just post a link where you can see the tracks.. hope that&amp;#039;s all right with everyone :-) 

Also the torrent IS NOT rarred or anything else silly to make your experience worse so you can go through the songs once you open the torrent file with your torrent client of choice :-)

Quality of tracks varies from 160kbps to 320kbps. They&amp;#039;re not scene ripped, but I didn&amp;#039;t hear any noticable ripping errors or anything.


